import ItemStyles from './styles/ItemStyles';

/* eslint-disable react/prop-types */
export default function Product({ product }) {
  return (
    <ItemStyles>
      <img src={product.photo.image.productUrlTransformed} alt={product.name} />
    </ItemStyles>
  );
}
